import createReactComponent from '../createReactComponent';
var PlusSquare = createReactComponent('PlusSquare', [['rect', {
  x: '3',
  y: '3',
  width: '18',
  height: '18',
  rx: '2',
  ry: '2',
  key: 'maln0c'
}], ['line', {
  x1: '12',
  y1: '8',
  x2: '12',
  y2: '16',
  key: '55jlg'
}], ['line', {
  x1: '8',
  y1: '12',
  x2: '16',
  y2: '12',
  key: '1myapg'
}]]);
export default PlusSquare;
